'''Sauron's invasion of Rohan''' was a conflict in the [[War of the Ring]] fought on [[11 March|11]] and [[12 March]], [[Third Age|T.A.]] [[Third Age 3019|3019]], beginning a day after [[Sauron]] launched [[Siege of Gondor|his assault on Minas Tirith]].

== Prelude ==

== The Battle ==
On 11 March, Orcs invaded [[the Wold]] from the North, but the [[Ents]] defeated them the next day.
